import { React } from "react";
import {
  BackgroundDiv,
  DivPorcoRossoImg,
  DivSuperior,
  DivTitulo,
  SubTitulo,
  TextoAzul,
  TextoBranco,
  TiraAzul,
  Titulo,
} from "./index.js";
import { PorcoRossoComendo } from "../imgs/PorcoRossoComendo.jsx";

const HomePage = () => {
  return (
    <BackgroundDiv>
      <DivSuperior>
        <DivTitulo>
          <Titulo>{"Porco Rosso"}</Titulo>
          <SubTitulo>{"Pizzaria"}</SubTitulo>
        </DivTitulo>
        <DivTitulo>
          <TextoAzul>{"Entrar"}</TextoAzul>
          <TextoAzul>{"Cadastro"}</TextoAzul>
        </DivTitulo>
      </DivSuperior>
      <TiraAzul>
        <TextoBranco>{"menu"}</TextoBranco>
        <TextoBranco>{"sobre nós"}</TextoBranco>
      </TiraAzul>
      <DivPorcoRossoImg>
        <PorcoRossoComendo />
      </DivPorcoRossoImg>
      <DivPorcoRossoImg>
        <PorcoRossoComendo />
      </DivPorcoRossoImg>
    </BackgroundDiv>
  );
};

export { HomePage };
